const serviceData=[{
  planName:'free',
  services:[
    { name:"basic resources",icon:"check" },
    { name:"basic community acces",icon:"check" },
    { name:"ebooks",icon:"check" },
    { name:"podcats",icon:"check" }
 ],
  amount:"$28 /month"
},
{
  planName:'standard',
  services:[
    { name:"basic resources",icon:"check" },
    { name:"basic community acces",icon:"check" },
    { name:"ebooks",icon:"check" },
    { name:"podcats",icon:"check" }
 ],
  amount:"$28 /month"
},
{
  planName:'Premium',
  services:[
    { name:"basic resources",icon:"check" },
    { name:"basic community acces",icon:"check" },
    { name:"ebooks",icon:"check" },
    { name:"podcats",icon:"check" }
 ],
  amount:"$28 /month"
}];

const planNameStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'25px',
  paddingTop:'10px',
  textTransform:'uppercase'
  // marginTop:'5px',
}

const amountStyles={
  display:'flex',
  justifyContent:'center',
  fontWeight:'normal',
  color:'white',
  fontSize:'35px',
  marginTop:'25px',
  marginBottom:'20px'
}

const listStyles={
  fontSize:"20px",
  color:'white',
  listStyleType:'none',
  textAlign:'left',

}

const buttonStyles={
  fontSize:'20px',
  marginBottom:'30px',
  borderRadius:'25px',
  backgroundColor:'white',
  paddingRight:'60px',
  paddingLeft:'60px',
  paddingTop:'5px',
  paddingBottom:'5px',
  color:'#008F69'
}

const buttonPosition={
  display:'flex',
  justifyContent:'center'
};


function App() {
  return (
    <div>
     <PriceCardDisplayV
    //  cardData={cardData}
     servicesData={servicesData}
     buttonText="Choose Plan"
     planNameStylesStyles={planNameStyles}
     amountStyles={amountStyles}
     listStyles={listStyles}
     buttonStyles={buttonStyles}
     buttonPosition={buttonPosition}
     />
    </div>
  );
}

export default App;
